    "description": "Rund 500 m langer Gruppenbau mit mehreren H&ouml;fen: Sammlungsbau im S&uuml;den, vierfl&uuml;gelige Anlage mit Mitteltrakt, &uuml;berdachten Binnenh&ouml;fen und vorspringenden elliptischen Mittelpavillon, mit Turm und Observatoriumskuppeln, als Eisenbetonbau in neuklassizistischen Formen, nach Entw&uuml;rfen von <a href=\"https://de.wikipedia.org/wiki/Gabriel_von_Seidl\" title=\"Gabriel von Seidl\">Gabriel von Seidl</a>, vollendet von <a href=\"https://de.wikipedia.org/wiki/Emanuel_von_Seidl\" title=\"Emanuel von Seidl\">Emanuel von Seidl</a> und <a href=\"https://de.wikipedia.org/wiki/Oswald_Bieber\" title=\"Oswald Bieber\">Oswald Eduard Bieber</a>, 1906–25; Bibliotheks- und Saalbau im Norden, in zwei Bauteilen mit vierfl&uuml;gligem Block mit Mitteltrakt um zwei Binnenh&ouml;fe als Bibliothek und ehem. Kongresssaal als basilikal gruppierter Bauk&ouml;rper, durch Fl&uuml;gel mit Uhrenturm mit dem Sammlungsbau verbunden, als <a href=\"https://de.wikipedia.org/wiki/Stahlskelettbau\" title=\"Stahlskelettbau\">Stahlskelettbau</a> in sachlichen Formen, von <a href=\"https://de.wikipedia.org/wiki/German_Bestelmeyer\" title=\"German Bestelmeyer\">German Bestelmeyer</a>, 1929–35; Kraftfahrzeughalle im &auml;u&szlig;ersten S&uuml;den als Anbau an den Sammlungsbau, zweigeschossiger Walmdachbau mit gro&szlig;fl&auml;chig verglaster Pfeilerfassade, von <a href=\"https://de.wikipedia.org/wiki/Karl_B%C3%A4%C3%9Fler_(Architekt)\" title=\"Karl B&auml;&szlig;ler (Architekt)\">Karl B&auml;&szlig;ler</a>, 1936–37; nach Kriegssch&auml;den alle Bauteile bis 1959 in stilistischer Kontinuit&auml;t wiederhergestellt durch Karl B&auml;&szlig;ler; mit Ausstattung.",
