    "description": "Bestehend seit dem 16. Jahrhundert zweiteilige Anlage: 1) Im Norden der langgestreckte Alte S&uuml;dliche Friedhof, seit 1788 Hauptfriedhof der Stadt, durch <a href=\"https://de.wikipedia.org/wiki/Gustav_Vorherr\" title=\"Gustav Vorherr\">Gustav Vorherr</a> um 1820/30 erweitert und im S&uuml;den halbkreisf&ouml;rmig abgeschlossen. Die umgebende, niedrige Mauer stark erneuert. Nordportale siehe Stephansplatz 2 (<a href=\"https://de.wikipedia.org/wiki/St._Stephan_(M%C3%BCnchen)\" class=\"mw-redirect\" title=\"St. Stephan (M&uuml;nchen)\">St. Stephan</a>). 2) Im S&uuml;den der fast quadratische Neue S&uuml;dliche Friedhof, 1844–50 von <a href=\"https://de.wikipedia.org/wiki/Friedrich_von_G%C3%A4rtner\" title=\"Friedrich von G&auml;rtner\">Friedrich von G&auml;rtner</a>, umgeben von hoher Rohbacksteinmauer mit Blendengliederung an der Au&szlig;enseite; die innen vorgelegten Arkadeng&auml;nge zerst&ouml;rt. Am Nordende zwischen Altem und Neuem Friedhof gew&ouml;lbte Pfeilerhalle von G&auml;rtner. Zahlreiche Gr&auml;ber von Bedeutung, verzeichnet bei Max Josef Hufnagel, Ber&uuml;hmte Tote im S&uuml;dlichen Friedhof zu M&uuml;nchen (1969).",
