    "description": "Weitl&auml;ufiger Komplex im sogenannten Korridorsystem in Formen des reduzierten Historismus mit zahlreichen Nebengeb&auml;uden. Von <a href=\"https://de.wikipedia.org/wiki/Richard_Schachner\" title=\"Richard Schachner\">Richard Schachner</a>, 1904–1913 und 1926–1928. Hauptgeb&auml;ude, dreigeschossiger repr&auml;sentativer Walmdachriegel mit Mittelrisalit, altanenartigem Arkadenvorbau und Mosaiken, von Richard Schachner, 1906/1907. Krankenhauskapellen, <a href=\"https://de.wikipedia.org/wiki/Heilig_Kreuz_(Schwabing-West)\" title=\"Heilig Kreuz (Schwabing-West)\">evangelisch-lutherische und katholische Heilig-Kreuz-Kapelle</a> mit Turm. Ehemalige Schwesternh&auml;user, dreigeschossiger Walmdachtrakt &ouml;stlich eines kreuzgang&auml;hnlichem Hofes. Verwaltungs- und Apothekengeb&auml;ude, dreigeschossiger hakenf&ouml;rmiger Walmdachbau. Krankenhausbauten, Mittelbau mit beidseitig durch G&auml;nge verbundene, um kleine Gartenh&ouml;fe gruppierte Seitenfl&uuml;geln und Nebengeb&auml;ude. Desinfektions- und Waschhaus, Gruppenbau mit Walmd&auml;chern. Kessel- und Maschinenhaus, zweigeschossiger Walmdachbau mit s&uuml;dseitigem Flachdachanbau. Pathologiegeb&auml;ude, dreigeschossiger Walmdachbau mit Treppenhausturm. Pf&ouml;rtnerhaus, erdgeschossiger Walmdachbau mit polygonalem Eckerker. Einfriedung, mit zahlreichen Pavillons besetzte Ringmauer. Profanskulputur, Ziers&auml;ulen mit von Bronzeschlangen umwundenen Kelchen. Brunnenhaus, mit Schweifgiebel, von Maximilian Schachner, 1911. Kinderkrankenhaus, viergeschossiger Walmdachbau mit Eckrisaliten und Erkern, von Richard Schachner, 1926–1928. Vgl. auch James-Loeb-Stra&szlig;e 2.",
