    "description": "1910–11, erweitert und erg&auml;nzt 1924–27, nach Sch&auml;den im Zweiten Weltkrieg wiederaufgebaut, davon die folgenden vier baulichen Anlagen: Gro&szlig;markthalle, Eisenbeton-Hallenkonstruktion als basilikal &uuml;berh&ouml;htes, spitzbogiges Mittelschiff zwischen niedrigen Nebenr&auml;umen, von <a href=\"https://de.wikipedia.org/wiki/Richard_Schachner\" title=\"Richard Schachner\">Richard Schachner</a>, 1910–11, nach Kriegszerst&ouml;rung nur Halle 1 im S&uuml;den des Komplexes noch original erhalten, und Verwaltungsfl&uuml;gel, &uuml;ber Betonbr&uuml;cken erschlossen, zweigeschossig, mit Erkern und Turm gegliedert, von Richard Schachner, 1910–11, s&uuml;dwestlich der Halle 1 vorgelagert. Ehem. Kartoffelhalle mit Dienstwohnungen, langgestreckter eingeschossiger Bau mit dreigeschossigen Kopfbauten, von Richard Schachner, 1912, 1924 Kopfbauten aufgestockt. St&auml;dtisches Kontorhaus der Gro&szlig;markthalle, f&uuml;nfgeschossiger Satteldachbau, in sachlich reduzierten Formen mit kr&auml;ftiger horizontaler Gliederung aus rohem Waschbeton, von <a href=\"https://de.wikipedia.org/wiki/Karl_Meitinger\" title=\"Karl Meitinger\">Karl Meitinger</a>, 1926–27, Attikageschoss, 1950 aufgesetzt. Neues Kontorhaus und Zollverwaltungsgeb&auml;ude der Gro&szlig;markthalle, f&uuml;nfgeschossiger Rasterbau mit weitem Dach&uuml;berstand und Vordach, von <a href=\"https://de.wikipedia.org/wiki/Philipp_Zametzer\" title=\"Philipp Zametzer\">Philipp Zametzer</a> und Albert Heichlinger, 1952–53, erweitert von Albert Heichlinger, 1958/59; Treppenhaus mit Ausmalung.",
