    "description": "Ab 1789 in den Isarauen durch <a href=\"https://de.wikipedia.org/wiki/Benjamin_Thompson\" title=\"Benjamin Thompson\">Benjamin Thompson Graf von Rumford</a> und <a href=\"https://de.wikipedia.org/wiki/Friedrich_Ludwig_Sckell\" class=\"mw-redirect\" title=\"Friedrich Ludwig Sckell\">Friedrich Ludwig von Sckell</a> angelegter Volksgarten (bis 1799 mit Milit&auml;rg&auml;rten verbunden), 1792 er&ouml;ffnet, ab 1799 von <a href=\"https://de.wikipedia.org/wiki/Reinhard_von_Werneck\" title=\"Reinhard von Werneck\">Reinhard Freiherr von Werneck</a> weiterentwickelt (Anlage des Sees), 1799 um die Hirschau nach Norden erweitert, ab 1804 von Friedrich Ludwig von Sckell gartenk&uuml;nstlerisch umgestaltet. Klassischer Landschaftsgarten, sich &uuml;ber f&uuml;nf Kilometer in den Isarauen erstreckend, mit geschwungenen Wasserl&auml;ufen und Wegen sowie weiten Sichtfl&auml;chen zwischen dem Baumbestand; Nordteil (Hirschau) rein landschaftlich, S&uuml;dteil (zwischen <a href=\"https://de.wikipedia.org/wiki/Prinzregentenstra%C3%9Fe\" title=\"Prinzregentenstra&szlig;e\">Prinzregentenstra&szlig;e</a> und <a href=\"https://de.wikipedia.org/wiki/Isarring\" title=\"Isarring\">Isarring</a>) mit Parkbauten und Denkm&auml;lern; Br&uuml;cken in gro&szlig;er Zahl &uuml;ber die Bachl&auml;ufe, vielfach mit Eisen- oder Steingel&auml;ndern vor allem des sp&auml;ten Historismus. <i>(Einzelbauwerke im Lehel, Bezirksteil Englischer Garten S&uuml;d, siehe <a href=\"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Lehel\" title=\"Liste der Baudenkm&auml;ler im Lehel\">Liste der Baudenkm&auml;ler im Lehel</a>)</i>.",
