    "description": "17-geschossiges Punkthochhaus &uuml;ber sternf&ouml;rmigem Grundriss, 51 m hoch; um einen zentralen Erschlie&szlig;ungskern mit Treppenhaus, Fahrst&uuml;hlen und M&uuml;llabwurfschacht sind pro Geschoss drei Wohnungen so angeordnet, dass eine gr&ouml;&szlig;tm&ouml;gliche Abgeschlossenheit gew&auml;hrleistet ist (Konzept von <a href=\"https://de.wikipedia.org/wiki/Emil_Freymuth\" title=\"Emil Freymuth\">Emil Freymuth</a>: Das Einfamilienhaus im Stockwerkbau), d. h. pro vorspringendem Trakt je eine Wohnung; Wohnungsgr&ouml;&szlig;en&nbsp;: 3½-Zimmer-Wohnungen bzw. 2 Zimmer und 3 Kammern; Stirnseite des S&uuml;dfl&uuml;gels ganz in Loggien aufgel&ouml;st, die S&uuml;dwest- bzw. S&uuml;dostkanten der Ost- und Westfl&uuml;gel in ihrer ganzen H&ouml;he lamellenartig aufgel&ouml;st durch die um die Hauskante herumgef&uuml;hrten Rundungen der Freisitzkragplatten und geschlossenen Br&uuml;stungen. Hohe gestalterische Qualit&auml;t durch markant rhythmisierte Fenstergruppierungen, fast putzb&uuml;ndig in die W&auml;nde eingeschnittenen Fenster&ouml;ffnungen ohne Putzrahmung, durch die schlanken S&auml;ulen, die die Loggien netzartig strukturieren, durch die Belichtungs&ouml;ffnungen der Treppenh&auml;user als schmale vertikale Glasachsen; keine Sockelwirkung des Kellergeschosses (doppelte Unterkellerung), Flachdach.",
