    "description": "Ehemaliges kurf&uuml;rstliches Jagdschloss, jetzt Exerzitienhaus, errichtet 1715–17 von <a href=\"https://de.wikipedia.org/wiki/Joseph_Effner\" title=\"Joseph Effner\">Joseph Effner</a>. Hauptbau: drei durch niedrige Zwischentrakte verbundene Pavillons. Im 2. Stock des Mittelrisalits Raum mit reichem Stuckdekor der Bauzeit. (&Uuml;brige Innenr&auml;ume mehrfach erneuert). Vorhof (mit Steinvase), flankiert von langgestreckten Nebengeb&auml;uden. Diese sind durch viertelkreisf&ouml;rmige Mauern mit der Einfahrt verbunden, einem Gitter (18. und 19. Jahrhundert) mit von Sandsteinl&ouml;wen bekr&ouml;nten Torpfeilern. Beiderseits davon kubische Pavillons (Nebengeb&auml;ude). Parallel zum &ouml;stlichen Hofgeb&auml;ude ein weiterer Nebenbau von ca. 1880, dem Schlosskomplex angepasst. Im S&uuml;dosten Gew&auml;chshaus mit anschlie&szlig;endem Neurenaissance-Pavillon (um 1880). Garten s&uuml;dlich des Schlosses, im franz&ouml;sischen Stil. Im zentralen Parterre neubarocke Steinplastiken, 1889 von Carl Fischer: Brunnen mit Faungruppe, vier Puttengruppen und zwei Vasen. Gartenmauer mit Blenden an der Innenseite. Eine weitere Mauer umschlie&szlig;t den ganzen Schlosskomplex. Im Garten Bruder-Konrad-Brunnen, 18. Jahrhundert, Figur modern, und (im ehemaligen Schimmelgarten) Delphinbrunnen mit Puttengruppe, wohl um 1715. St&auml;dtebaulich zugeh&ouml;rig die auf das Schloss zuf&uuml;hrende Allee, siehe Olympiastra&szlig;e.",
